__NUXT_JSONP__("/drugs/Vinflunine", (function(a,b,c){return {data:[{drug:{slug:a,emaEpar:[{activeSubstance:b,conditionIndication:"Javlor is indicated in monotherapy for the treatment of adult patients with advanced or metastatic transitional-cell carcinoma of the urothelial tract after failure of a prior platinum-containing regimen.Efficacy and safety of vinflunine have not been studied in patients with performance status ≥ 2.",inn:b,marketingAuthorisationDate:"2009-09-21 00:00:00",marketingAuthorisationHolder:"Pierre Fabre Médicament",medicineName:"Javlor",url:"https:\u002F\u002Fwww.ema.europa.eu\u002Fen\u002Fmedicines\u002Fhuman\u002FEPAR\u002Fjavlor"}],fdaDrugLabel:[],id:a,nciThesaurus:{casRegistry:"162652-95-1",chebiId:"",chemicalFormula:"C45H54F2N4O8",definition:"A bi-fluorinated derivative of the semi-synthetic vinca alkaloid vinorelbine with antitubulin, antineoplastic, and antiangiogenic activities. Vinflunine inhibits tubulin assembly without any stablization of assembled microtubules at concentrations comparable to those of other vinca alkaloids such as vincristine, vinblastine and vinorelbine; this effect on microtubule dynamics results in cell cycle arrest in mitosis and apoptosis. Compared to other vinca alkaloids, this agent binds weakly to the vinca-binding site, indicating that vinflunine may exhibit reduced neurotoxicity.",fdaUniiCode:"5BF646324K",identifier:"C61564",preferredName:a,semanticType:"Organic Chemical",subclassOf:["C67422","C932"],synonyms:["4'-Deoxy-20',20'-difluoro-C'-norvincaleukoblastine","VINFLUNINE",a,b]},dir:"\u002Fdrugs",path:"\u002Fdrugs\u002FVinflunine",extension:".json",createdAt:c,updatedAt:c}}],fetch:{},mutations:void 0}}("Vinflunine","vinflunine","2021-10-30T13:41:34.943Z")));